import React from 'react';
import classNames from "classnames/bind";
import logo from "../../../image/logo.png";
import style from "./Header.module.scss";
import { Link } from "react-router-dom";
import { FiBell, FiSettings } from "react-icons/fi";
import AccountMenu from "./AccountMenu"; // Chèn đường dẫn đúng đến tệp tin AccountMenu

export default function Header() {
  const cx = classNames.bind(style);

  return (
    <div className={cx("wrapper")}>
      <div className={cx("logo")}>
        <img src={logo} alt="Logo" className={cx("logo-image")} />
      </div>
      <div className={cx("menu")}>
        {/* Các mục menu */}
      </div>
      <div className={cx("notification-icon")}>
        <Link to="/notifications" className={cx("notification-link")}>
          <FiBell />
        </Link>
      </div>
      <AccountMenu /> {/* Chèn component AccountMenu */}
    </div>
  );
}
